import AppLayout from '../components/AppLayout';

const Home = () => {
  return (
    <>
    <Head>
        <title>Profile Page</title>
        <link
          rel="stylesheet"
          href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap"
        />
    </Head>
  <AppLayout>Hello, Next!</AppLayout>

    </>
  )
}

export default Home;
